heroSkillCfg={

-- isEffectAll 是否影响所有部队， 0 不影响， 1 影响
-- conditionType 技能生效的条件
--  1：部队处于山地  2：部队处于沙漠  3：部队处于平原  4：部队处于丛林  5：部队处于沼泽  6：部队处于城市
--  0：任何情况下均生效
--  21 ： 部队处于阵型中的前排 22 ：部队处于阵型中的后排 23 ：部队处于首轮战斗 24 ：部队处于2~3轮战斗 25 ：部队处于4轮后战斗
--  26 ：将领指挥部队为坦克时 27 ：将领指挥部队为歼击车时 28: ：将领指挥部队为自行火炮时 29 ：将领指挥部队为火箭车时
--  30 ：攻击者和被攻击者处于直线时 31 ：攻击者和被攻击者处于斜线时 32 ： 指挥部队比敌对部队数量多时 33: ：指挥部队比敌对部队数量少时
--  34 ：指挥部队为活动坦克时 35 ： 敌对部队没有将领的时候
--  41：判断初始攻击  42 ：判断初始血量  43：判断初始命中   44：判断初始闪避
--  45：判断敌方是否闪避  46：判断我方是否闪避  47：判断炮弹数是否大于敌方  48：判断炮弹数是否小于敌方

-- attType : 1, 攻击，2，防御，3，命中，4，闪避，5，暴击，6，免爆，11，增加己方先手值，12，减少敌方先手值，13，减少自身闪避（antievade），14，给敌方挂降低伤害debuff（dmg_debuff）
-- effectType ：0 是 初始开始判断 1是战斗中判断
-- attValuePerLv 每一级增加的技能数值多少
-- skillPower 每一次增加的技能强度

